            var sessions = new List<Session>();
            var clientFrameReader = new Http2FrameReader(EndPointType.Client);
            var serverFrameReader = new Http2FrameReader(EndPointType.Server);
            var reader = new Http2Reader(256 * 1024 * 1024);
            clientFrameReader.FrameReceived += frame => reader.HandleRequest(frame);
            serverFrameReader.FrameReceived += frame => reader.HandleResponse(frame);
            reader.HttpResponseSent += session => sessions.Add(session);

            clientFrameReader.HandleReceive("UFJJICogSFRUUC8yLjANCg0KU00NCg0KAAASBAAAAAAAAAEAAQAAAAQAAgAAAAUAAEAAAAAECAAAAAAAAL8AAQAABQIAAAAAAwAAAADIAAAFAgAAAAAFAAAAAGQAAAUCAAAAAAcAAAAAAAAABQIAAAAACQAAAAcAAAAFAgAAAAALAAAAAwAAAAUCAAAAAA0AAAAA8A==");
