            serverFrameReader.HandleReceive("AAAAAAEAAAAP");

            clientFrameReader.HandleReceive("AAAbASUAAAARAAAACxWCBYliUfcxD1LmIf/Ih8fGxcTCwL++AAAECAAAAAARAL4AAA==");
            serverFrameReader.HandleReceive("");
            serverFrameReader.HandleReceive("");
            serverFrameReader.HandleReceive("");
            serverFrameReader.HandleReceive("");
            serverFrameReader.HandleReceive("");
            serverFrameReader.HandleReceive("");
            serverFrameReader.HandleReceive("AAAAAAEAAAAR");

            sessions.Count.Is(2);

            sessions[0].Request.ToString().Is(@"GET /wp-content/uploads/2018/01/AltMenuIssue.png HTTP/2.0
